response.about:
Ненормальный, неформальный, невоспитанный, немодный, нахуй никому не нужный и поэтому свободный! Я давно забил на то, что меня не понимают, да я хуй ложил на все, из штанов не вынимая! 

Я - умный, вокруг козлы;
Я - честный, вокруг жулье; 
Я - гений, вокруг быдло;
Я - Д'Артаньян, все пидарасы!

the great person is the one that makes everyone feel great =)

There are those who are caught;
And some who are made to pay;
And those who are bought;
And the rest who get away =)
